import React from "react";
import notes from "../notes";



console.log(addedNotes);

function Note() {
  var addedNotes = notes.map(function(item) {
    return (
      <div>
        <h1>{item.title}</h1>
        <p>{item.content}</p>
      </div>
    )
  })
}

export default Note;
